import React from 'react';
class Nav  extends React.Component {

    render() { 
        return ( 
            <nav className="nav">
<ul class="Menu-content">
    <li><a href="">Home</a></li>
    <li>    Gallery</li>
    <li>Order Online</li>
    <li>About Me</li>
    <li>Contact Me</li>
</ul>
            </nav>
         );
    }
}
 
export default Nav ;
